import { List } from "@mui/material";
import React from "react";
import UserCards from "../Components/UserCards";

function Browse() {
  return (
    <div>
      <List>
        <UserCards />
        <UserCards />
        <UserCards />
      </List>
    </div>
  );
}

export default Browse;
